import React, { Component } from 'react';
import { connect } from 'react-redux'
import { fetchItinerariesList } from '../store/actions/itinerariesActions'
// import { Link } from 'react-router-dom';



class Itineraries extends Component {

    constructor(props) {
        super(props);
        this.state = {
            itineraries: [],
            city:"",
            fetchItineraryList: []
        }
    }

    componentDidMount() {
        let city = window.location.pathname.split('/')[2]
        this.props.fetchItinerariesList(city);
    }


    render() {

        // const {itineraries} =this.props;
        // console.log(itineraries)

    return (
        <div className="flex-container">

            <div className="itineraries-list">

              <ul>
                  {/* <li className="itinerary" key={itineraries._id}>
                      {this.state.cityItineraries}
                  </li> */}
              </ul>

            </div>

        </div>
    )
}
}
const mapStateToProps = state => {
    return {
        itineraries: state.itineraries.itineraries,
        loading: state.itineraries.loading
    }
}

const mapDispatchToProps = dispatch => {
    return {
        fetchItinerariesList: (city) => dispatch(fetchItinerariesList(city))
    }
}


export default connect(
    mapStateToProps,
    mapDispatchToProps
)(Itineraries)
